import React from "react";
import "./Login.css";
import { Link, useHistory } from "react-router-dom";
function Login() {
  return (
    <div className="login">
      <Link to="/">
        <ShopTwoToneIcon className="login__logo" />
      </Link>
    </div>
  );
}

export default Login;
